#include <bits/stdc++.h>
using namespace std;

class Trie {
	struct node {
		char _data;
		node * _links[26];
		bool _positive, _negative;

		node(char data) : _data(data), _links() {}
		void traversing(bool is_positive) {
			if (is_positive) _positive = true;
			else _negative = true;
		}
	};

	bool _possible;
	vector<string> _filters;
	node * _roots[26];
	node * _insert(node * n, const string &s, int pos, bool is_positive) {
		if (!n) n = new node(s[pos]);
		n -> traversing(is_positive);
		if (pos + 1 < s.length()) { 
			n -> _links[(int)s[pos + 1] - 97] = _insert(n -> _links[(int)s[pos + 1] - 97], s, pos + 1, is_positive);
		}
		return n;
	}
	void _print(node * n, string s) {
		if (!_possible) return;
		s += n -> _data;
		
		if (n -> _negative && !n -> _positive) _filters.push_back(s);
		else if (n -> _negative && n -> _positive) {
			int n_count = 0;
			for (int i = 0; i < 26; i++) {
				if (n -> _links[i]) {
					n_count += n -> _links[i] -> _negative;
					_print(n -> _links[i], s);
				}
			}
			if (!n_count) _possible = false;
		}
	}

public:
	Trie() : _roots() { _possible = true; }
	void insert(const string &s, bool is_positive) {
		_roots[(int)s[0] - 97] = _insert(_roots[(int)s[0] - 97], s, 0, is_positive);
	}
	void printAll() {
		for (int i = 0; i < 26; i++) if (_roots[i]) _print(_roots[i], "");
		if (_possible) {
			cout << _filters.size() << "\n";
			for (int i = 0; i < _filters.size(); i++) cout << _filters[i] << "\n";
		}
		else cout << "-1";
	}

};

int main(int argc, char const *argv[])
{

	Trie t;
	int n;
	char ch;
	string s;

	cin >> n;
	while (n--) {
		cin >> ch >> s;
		t.insert(s, (ch == '+'));
	}
	t.printAll();
	return 0;
}

